import React from 'react';
import Typical from 'react-typical';
import possibilityImage from '../../assets/header.svg';
import './header.css';

const Header = () => (
  <div className="gpt3__header gpt3__header-padding" id="home">
    <div className="gpt3__header-content">
      <h1 className="gradient__text">SentenceSmith: Create amazing content with the power of AI!</h1>
      <p>
        <Typical
          loop={Infinity}
          steps={[
            'Create a tag line for an ice cream shop.',
            1000,
            'Write a Love Letter written in BASIC.',
            1000,
            'Generate futuristic ideas for startups, apps, or marketplaces:',
            1000,
          ]}
        />
      </p>

      <div className="gpt3__header-content__input">
        <input type="email" placeholder="Enter a prompt" />
        <button type="button">Magic Stuff</button>
      </div>
    </div>

    <div className="gpt3__header-image">
      <img src={possibilityImage} />
    </div>
  </div>
);

export default Header;
